import React, { Component, Fragment } from 'react';
import { Carousel, WingBlank, Tabs, WhiteSpace, SearchBar, Flex } from 'antd-mobile';
const tabs = [
    { title: '饮品' },
    { title: '甜品' },
    { title: '书本' },
];

class Shope extends Component {
    constructor(props) {
        super(props)
        this.state = {

        }
    }

    render() {
        return (
            <Fragment>
                <div className="col" >
                    <SearchBar placeholder="Search Book" maxLength={8} />
                    <div style={{ height: 400 }} >
                        <WhiteSpace />
                        <Tabs tabs={tabs}
                            initalPage={'t2'}
                            tabBarPosition="left"
                            tabDirection="vertical"
                        >
                            <div style={{ display: 'flex', alignItems: 'center', justifyContent: 'center', height: '400px', backgroundColor: '#fff' }}>
                                Content of first tab
      </div>
                            <div style={{ display: 'flex', alignItems: 'center', justifyContent: 'center', height: '400px', backgroundColor: '#fff' }}>
                                Content of second tab
      </div>
                            <div style={{ display: 'flex', alignItems: 'center', justifyContent: 'center', height: '400px', backgroundColor: '#fff' }}>
                                Content of third tab
      </div>
                        </Tabs>
                        <WhiteSpace />
                    </div>

                </div>

            </Fragment>
        );
    }

}

export default Shope;
